The State files an Amended Information which charges disorderly conduct, contrary to Section 947.01(1) of the Wisconsin Statutes.  
NO CONTEST plea entered to the amended charge. Convicted.
Sentence Withheld.  Defendant is placed on probation to DOC for twelve (12) months.
Conditions of probation:
1) Assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
2) Any counseling as recommended by the agent;
3) Pay court costs;
4) pay supervision fees in an amount to be determined by DOC.
Minutes.
